     void writeARFFRandom(String path, boolean useKey){
        
         Random rand=new Random();
         
        try{
         FileWriter fw = new FileWriter(path);
         
         fw.write("@RELATION   "+relationName+"\n\n");
         for(int i=0;i<attributes.size();i++){
             if(useKey==false && i==0)
                 continue;
             fw.write("@ATTRIBUTE   "+attributes.get(i).getValue0()+"    "+attributes.get(i).getValue1()+"\n");
         }
         fw.write("@ATTRIBUTE   "+"class    {1,0}\n\n");
         fw.write("@DATA\n");
         for(int i=0;i<data.size();i++){
             if(useKey==true)
              fw.write(keys.get(i)+", ");
             for(int j=0;j<data.get(i).size();j++){
                 double num= 0 + (2 - 0) * rand.nextDouble();
                 fw.write(num+",");
             }
                 //fw.write(data.get(i).get(j)+", ");
             fw.write(""+Labels.get(i));
             fw.write("\n");
         }
         fw.close();
        }
        catch(Exception e)
                {e.printStackTrace();}
    } 
    
